import{_ as a,o as e,c as r,e as d}from"./app.efeddd24.js";const n={},o=d('<h1 id="geek-\u5927\u7EB2" tabindex="-1"><a class="header-anchor" href="#geek-\u5927\u7EB2" aria-hidden="true">#</a> geek \u5927\u7EB2</h1><h2 id="\u4ECE-markdown-\u8BF4\u8D77-\u8BF4\u8BF4\u4E24\u79CD\u8BA1\u7B97\u673A\u6587\u5316" tabindex="-1"><a class="header-anchor" href="#\u4ECE-markdown-\u8BF4\u8D77-\u8BF4\u8BF4\u4E24\u79CD\u8BA1\u7B97\u673A\u6587\u5316" aria-hidden="true">#</a> \u4ECE markdown \u8BF4\u8D77, \u8BF4\u8BF4\u4E24\u79CD\u8BA1\u7B97\u673A\u6587\u5316</h2><ul><li>markdown \u7684\u673A\u5236: \u4ECE markdown \u5230 html</li><li>\u7ED3\u6784, \u6837\u5F0F, \u4EA4\u4E92\u7684\u5206\u79BB, \u5206\u79BB\u7684\u610F\u4E49: \u81EA\u7531\u534F\u4F5C</li><li>markdown \u5F53\u524D\u7684\u89E3\u6790\u6807\u51C6\u96BE\u9898, \u89C4\u8303\u5BF9\u4E8E\u534F\u4F5C\u7684\u91CD\u8981\u6027</li><li>\u8BA1\u7B97\u673A\u6587\u5316\u7684\u53CC\u91CD\u6027: \u4E25\u683C\u7684\u89C4\u8303\u548C\u81EA\u7531\u7684\u534F\u4F5C.</li></ul><p>\u4E0A\u671F\u8282\u76EE\u4E2D\u6211\u4EEC\u63D0\u5230 markdown, \u5E76\u4E3B\u5F20\u6240\u6709\u4EBA\u90FD\u5E94\u8BE5\u5B66\u4E60\u4E00\u4E0B\u5982\u4F55\u4F7F\u7528 makrdown. \u8FD9\u91CC\u6211\u4EEC\u53EF\u4EE5\u4ECE\u8BE6\u7EC6\u8BF4\u8BF4 markdown \u5F00\u59CB, \u8BF4\u8BF4\u6280\u672F\u80CC\u540E\u6240\u85CF\u533F\u7684\u601D\u7EF4\u65B9\u5F0F.</p><p>markdown \u672C\u8D28\u4E0A\u8BB2\u662F\u4E00\u79CD\u6807\u8BB0\u8BED\u8A00. \u6240\u4EE5\u6807\u8BB0\u8BED\u8A00\u5C31\u662F, \u5C31\u662F\u5728\u6587\u672C\u5185\u5BB9\u4E2D\u6DFB\u52A0\u4E00\u4E9B\u6807\u8BB0, \u6765\u63D0\u793A\u5904\u7406\u6587\u672C\u7684\u7A0B\u5E8F\u5982\u4F55\u5904\u7406\u8FD9\u90E8\u5206\u6587\u672C. \u800C\u6211\u4EEC\u65E5\u5E38\u751F\u6D3B\u4E2D\u6700\u5E38\u89C1\u7684\u6807\u8BB0\u8BED\u8A00, \u5C31\u662F\u7F51\u9875\u6587\u4EF6 html \u6587\u4EF6. \u901A\u5E38\u6765\u8BF4, \u5BF9 markdown \u8FDB\u884C\u5C55\u793A\u65F6, \u6B63\u662F\u5C06 markdown \u6587\u6863\u8F6C\u5316\u6210\u4E3A html \u8FDB\u884C\u663E\u793A.</p><p>\u4E3A\u4EC0\u4E48\u8981\u8FD9\u6837\u505A\u5462? \u5176\u5B9E\u8FD9\u662F <code>\u7ED3\u6784, \u6837\u5F0F, \u4EA4\u4E92\u5206\u79BB</code> \u601D\u8DEF\u7684\u8FDB\u4E00\u6B65\u6DF1\u5316. \u6211\u4EEC\u77E5\u9053, \u6211\u4EEC\u6253\u5F00\u4E00\u4E2A\u7F51\u9875, \u5B83\u6700\u7EC8\u7684\u5448\u73B0\u662F\u7531\u4E09\u7C7B\u6587\u4EF6\u51B3\u5B9A\u7684, html \u6587\u4EF6\u786E\u5B9A\u4E86\u9875\u9762\u7684\u5185\u5BB9\u548C\u7ED3\u6784, css \u6587\u4EF6\u51B3\u5B9A\u4E86\u9875\u9762\u7684\u6837\u5F0F, javascript \u51B3\u5B9A\u4E86\u9875\u9762\u4EA4\u4E92. \u5C31\u597D\u50CF html \u662F\u4E00\u4E2A\u4EBA\u7684\u9AA8\u8089\u8EAB\u4F53, css \u662F\u4E00\u4E2A\u4EBA\u7684\u8863\u7740\u88C5\u9970, javascript \u662F\u4E00\u4E2A\u4EBA\u884C\u4E3A\u65B9\u5F0F. \u5C31\u5982\u540C\u4E00\u4E2A\u4EBA\u53EF\u4EE5\u6362\u4E0D\u540C\u7684\u8863\u670D, \u5448\u73B0\u4E0D\u540C\u7684\u6837\u8C8C, \u53EF\u4EE5\u6362\u4E0D\u540C\u7684\u884C\u4E3A\u65B9\u5F0F, \u505A\u4E0D\u540C\u7684\u4E8B\u60C5\u4E00\u6837, \u4E00\u4E2A html \u53EF\u4EE5\u901A\u8FC7\u4E0D\u540C css \u6837\u5F0F\u548C javascript \u5448\u73B0\u51FA\u5B8C\u5168\u4E0D\u540C\u7684\u72B6\u6001. \u90A3\u8FD9\u6837\u505A\u6709\u4EC0\u4E48\u597D\u5904\u5462? \u6700\u540E\u8981\u7684\u597D\u5904\u5728\u4E8E, \u8FD9\u6837\u53EF\u4EE5\u4F7F\u521B\u4F5C\u9875\u9762\u5185\u5BB9\u7684\u65F6\u5019, \u5B8C\u5168\u4E0D\u7528\u8003\u8651\u5B83\u6700\u7EC8\u5448\u73B0, \u800C\u53EA\u8981\u5173\u6CE8\u5185\u5BB9\u672C\u8EAB, \u4EE5\u53CA\u5185\u5BB9\u5728\u6574\u4F53\u7ED3\u6784\u4E2D\u7684\u4F5C\u7528\u5C31\u884C\u4E86. \u800C\u6587\u4EF6\u7684\u5448\u73B0\u6837\u5F0F\u548C\u4EA4\u4E92, \u53EF\u4EE5\u4EA4\u7ED9\u5176\u4ED6\u66F4\u4E13\u4E1A\u7684\u6765\u5904\u7406. \u8FD9\u5C31\u4F7F\u5F97\u7F51\u9875\u7684\u521B\u4F5C\u8FC7\u7A0B\u53EF\u4EE5\u8FDB\u884C\u5206\u5DE5\u534F\u4F5C. \u6BCF\u4E2A\u5206\u5DE5\u4E2D, \u4EBA\u4EEC\u53EA\u7528\u8003\u8651\u597D\u81EA\u5DF1\u7684\u5DE5\u4F5C\u5185\u5BB9\u5C31\u597D. markdown \u662F\u8FD9\u79CD\u601D\u8DEF\u7684\u8FDB\u4E00\u6B65\u6DF1\u5316. \u5C31\u662F\u5C06 html \u7684\u6807\u8BB0\u8BED\u8A00\u8FDB\u4E00\u6B65\u7B80\u5316, \u53BB\u6389\u5176\u4E2D\u4E0E\u65E5\u5E38\u6587\u6863\u5199\u4F5C\u65E0\u5173\u7684\u6807\u8BB0\u5185\u5BB9, \u628A\u5176\u5B83\u7684\u6807\u8BB0\u66F4\u8FDB\u4E00\u6B65\u7B80\u5316. \u8FD9\u6837\u6587\u6863\u7684\u521B\u4F5C\u8005, \u5728\u521B\u4F5C\u6587\u6863\u7684\u65F6\u5019, \u53EF\u4EE5\u5B8C\u5168\u4E0D\u8003\u8651\u6587\u6863\u7684\u663E\u793A, \u800C\u53EA\u9700\u8981\u4E13\u5FC3\u4E8E\u6587\u6863\u5185\u5BB9\u7684\u521B\u4F5C. \u81F3\u4E8E\u6587\u6863\u6700\u7EC8\u5448\u73B0\u7684\u6837\u5B50, \u6211\u4EEC\u53EF\u4EE5\u53BB\u7F51\u4E0A\u627E\u6211\u4EEC\u5176\u4ED6\u66F4\u7CBE\u901A\u6392\u7248\u6837\u5F0F\u7684\u4EBA\u505A\u7684\u6837\u5F0F\u6A21\u677F. \u628A\u5BF9\u4E8E\u6211\u4EEC\u6700\u91CD\u8981\u5185\u5BB9\u521B\u4F5C\u628A\u63E1\u5728\u81EA\u5DF1\u624B\u4E2D, \u800C\u81EA\u7531\u7684\u8BA9\u66F4\u4E13\u4E1A\u7684\u4EBA\u4E3A\u6211\u4EEC\u6587\u6863\u5448\u73B0\u6837\u5F0F\u8D1F\u8D23.</p><p>\u4F46\u662F markdown \u76EE\u524D\u5B58\u5728\u4E00\u4E2A\u95EE\u9898, \u5C31\u662F EC \u5728\u64CD\u4F5C\u7CFB\u7EDF\u90A3\u4E00\u671F\u8282\u76EE\u7684\u56DE\u590D\u4E2D\u63D0\u5230\u7684\u89E3\u6790\u5668\u6807\u51C6\u95EE\u9898. \u6211\u4EEC\u901A\u8FC7\u524D\u8FB9\u7684\u63CF\u8FF0, \u5DF2\u7ECF\u77E5\u9053 markdown \u6700\u7EC8\u5448\u73B0\u51FA\u6765, \u662F\u8981\u628A markdwon \u6587\u4EF6\u8F6C\u6362\u5728 ( \u89E3\u6790\u6210 ) html \u6587\u4EF6, \u518D\u6309\u7167\u7F51\u9875\u7684\u5F62\u5F0F\u8FDB\u884C\u5C55\u793A. \u4F46\u662F\u76EE\u524D\u5B58\u5728\u8FD9\u6837\u4E00\u4E2A\u95EE\u9898: \u73B0\u5728\u4E0D\u540C\u7684\u89E3\u6790\u5668\u5BF9\u4E8E\u540C\u4E00\u4E2A markdown \u7684\u6807\u8BB0\u5185\u5BB9, \u8F6C\u5316\u6210\u4EC0\u4E48 html \u6807\u8BB0\u5185\u5BB9\u5E76\u4E0D\u4E00\u81F3. \u4E3E\u4E2A\u4F8B\u5B50, \u6709\u7684\u89E3\u6790\u5668, \u628A\u4E00\u6B21\u6362\u884C\u89E3\u6790\u6210\u7A7A\u683C, \u628A\u4E24\u6B21\u4EE5\u4E0A\u7684\u6362\u884C\u89E3\u6790\u6210\u6362\u884C, \u4F46\u6709\u7684\u89E3\u6790\u5668, \u5374\u76F4\u63A5\u628A\u4E00\u6362\u884C\u5C31\u76F4\u63A5\u89E3\u6790\u6210\u6362\u884C. \u8FD9\u5C31\u5BFC\u81F4\u540C\u4E00\u4E2A markdown \u6587\u4EF6\u5728\u8FDB\u884C\u663E\u793A\u7684\u65F6\u5019, \u53EF\u4EE5\u663E\u793A\u51FA\u6765\u7684\u6837\u5B50\u4E0E\u6211\u4EEC\u9884\u671F\u7684\u4E0D\u4E00\u6837. \u5F53\u7136, \u6211\u4EEC\u53EF\u4EE5\u901A\u8FC7\u4E00\u771F\u9009\u62E9\u4E00\u79CD\u89E3\u6790\u5668\u6765\u8FDB\u884C markdown \u6587\u6863\u7684\u89E3\u6790, \u4F46\u8FD9\u5C31\u4F7F\u6211\u4EEC\u7684\u534F\u4F5C\u4E0D\u90A3\u4E48\u81EA\u7531\u4E86.</p><p>\u4ECE markdown \u7684\u4F8B\u5B50, \u6211\u4EEC\u5176\u5B9E\u770B\u5230\u4E86\u8BA1\u7B97\u673A\u6587\u5316\u7684\u4E24\u4E2A\u89D2\u5EA6: \u4E25\u683C\u7684\u6807\u51C6\u548C\u81EA\u7531\u7684\u534F\u4F5C. \u8BA1\u7B97\u5668\u7CFB\u7EDF\u901A\u8FC7\u5BF9\u4FE1\u606F\u7684\u6807\u51C6\u5316\u5904\u7406, \u4F7F\u4EBA\u4EEC\u53EF\u4EE5\u66F4\u81EA\u7531\u7684\u8FDB\u884C\u534F\u4F5C. \u6211\u4EEC\u77E5\u9053\u4E92\u8054\u7F51\u672C\u8EAB\u5C31\u662F\u6784\u7B51\u5728\u4E00\u5C42\u5C42\u7684\u534F\u8BAE\u6807\u51C6\u4E0A\u7684. \u6B63\u662F\u5927\u5BB6\u90FD\u9075\u5B88\u4E00\u6837\u7684\u6807\u51C6, \u6240\u4EE5\u5927\u5BB6\u624D\u53EF\u4EE5\u8FDB\u884C\u81EA\u7531\u534F\u4F5C. \u8FD9\u4E5F\u6784\u6210\u4E86\u6211\u4EEC\u73B0\u5728\u8FD9\u4E2A\u6280\u672F\u4E16\u754C\u7684\u57FA\u672C\u5F62\u6001.</p><p>\u4F46\u8FD9\u4E24\u79CD\u6587\u5316\u5E76\u4E0D\u662F\u8BA1\u7B97\u8BA1\u8BDE\u751F\u4EE5\u6765\u65E2\u5982\u6B64\u878D\u5408, \u800C\u662F\u5728\u4E00\u4E2A\u957F\u671F\u7684\u5BF9\u6297\u4E2D\u5F62\u6210\u73B0\u5728\u7684\u6837\u5B50. \u8FD9\u4E2A\u5BF9\u6297, \u5C31\u662F\u6743\u529B\u548C geek \u7684\u5BF9\u6297. \u6240\u4EE5\u4EC5\u4EC5\u662F\u7231\u597D\u6280\u672F\u7684\u6280\u672F\u5B85, \u8FD8\u4E0D\u80FD\u5C31\u8BF4\u662F geek, geek \u672C\u8D28\u4E0A\u662F\u4E00\u79CD\u653F\u6CBB\u8EAB\u4EFD.</p><h2 id="\u4E24\u79CD\u8BA1\u7B97\u673A\u6587\u5316\u7684\u8C31\u7CFB" tabindex="-1"><a class="header-anchor" href="#\u4E24\u79CD\u8BA1\u7B97\u673A\u6587\u5316\u7684\u8C31\u7CFB" aria-hidden="true">#</a> \u4E24\u79CD\u8BA1\u7B97\u673A\u6587\u5316\u7684\u8C31\u7CFB</h2><ul><li>\u4FE1\u606F\u7CFB\u7EDF\u7684\u8D77\u6E90: \u519B\u4E8B\u4FE1\u606F\u5904\u7406.</li><li>\u4ECE\u96C6\u4E2D\u4FE1\u606F\u5904\u7406\u5230\u5F00\u6E90\u534F\u4F5C\u7684\u53D1\u5C55</li></ul>',11),l=[o];function t(i,m){return e(),r("div",null,l)}var c=a(n,[["render",t],["__file","geek\u5927\u7EB2.html.vue"]]);export{c as default};
